(185, 15, '诡案罪7', '', '未知', '', '', '', '“诡案罪”系列第7部主人公“我”从警校毕业后，进入公安系统工作。我的理想是当一名刑警，可是领导却把我安排到档案科坐班。为了工作的需要，我开始翻看档案架上那一卷卷落满灰尘的档案。这是一个名叫青阳的小城，在翻看档案和县志的过程中，发生在这里从古到今的离奇悬案一一展现。就让“我”将这些读来既使人警醒，又引人深思的探案故事，一一为读者道来。作者:岳勇  演播: 春风洗耳', 'http://imagev2.xmcdn.com/group18/M0B/FB/54/wKgJJVqMU7KjpXTuAAKGlUst4Tk842.jpg', '', 1530072261, 8, 0, 0, 0, 0, 1, 1, 2, 8, 'ting', '', '第01章$http://audio.xmcdn.com/group26/M0A/24/AB/wKgJRlqMVMzg6Mf9AEhuN2quBs8716.m4a\r\n第02章$http://audio.xmcdn.com/group26/M0A/24/AB/wKgJRlqMVM-Ci2N2AEEyhlAOD7E365.m4a\r\n第03章$http://audio.xmcdn.com/group26/M0A/25/6C/wKgJWFqMVNnwfHHkAEQPRvQbZJQ335.m4a\r\n第04章$http://audio.xmcdn.com/group26/M0A/25/6D/wKgJWFqMVOCwaL2DAE6buhC5wAs718.m4a\r\n第05章$http://audio.xmcdn.com/group26/M0A/25/6E/wKgJWFqMVOngQ_qyAEk9RDiYcEk990.m4a\r\n第06章$http://audio.xmcdn.com/group17/M04/FE/61/wKgJJFqNfdnh6nEIAEtPXiJ49F8919.m4a\r\n第07章$http://audio.xmcdn.com/group17/M04/FE/64/wKgJJFqNfePyp_wIAEiFtBXqY9I497.m4a\r\n第08章$http://audio.xmcdn.com/group17/M04/FE/B6/wKgJKVqNfe6RUIPGAEC1ssDWhpU684.m4a\r\n第09章$http://audio.xmcdn.com/group36/M00/EE/2C/wKgJTVqNfgLBe2YXAEQspHeH5lg051.m4a\r\n第10章$http://audio.xmcdn.com/group2/M00/45/3A/wKgJRVqNfg3QVF93AETRGtV0mgs312.m4a\r\n第11章$http://audio.xmcdn.com/group26/M06/2B/51/wKgJRlqPtz2zEpkFAEe1MG6yK5o157.m4a\r\n第12章$http://audio.xmcdn.com/group26/M06/2B/51/wKgJRlqPtz3z2XK7AEolSBnBtY4425.m4a\r\n第13章$http://audio.xmcdn.com/group26/M06/2C/12/wKgJWFqPtz-RrRnmAEKOiHrR6K8631.m4a\r\n第14章$http://audio.xmcdn.com/group33/M06/51/5A/wKgJUVqPt1bgJJO5AEzOoaFop2Q723.m4a\r\n第15章$http://audio.xmcdn.com/group33/M06/51/5B/wKgJUVqPt1fj7Be0AEK2L3R-O4A816.m4a\r\n第16章$http://audio.xmcdn.com/group37/M0B/73/9A/wKgJoFqQ4HqSr156AE_LrmO_fSA119.m4a\r\n第17章$http://audio.xmcdn.com/group37/M0B/73/F2/wKgJoVqQ4ITyS4SFAEavzXE_ET4021.m4a\r\n第18章$http://audio.xmcdn.com/group18/M07/03/F6/wKgJKlqQ4IrjogSqAEieq1HL6sw530.m4a\r\n第19章$http://audio.xmcdn.com/group18/M07/04/8B/wKgJJVqQ4JLS4DeeAEijEtf5zAM029.m4a\r\n第20章$http://audio.xmcdn.com/group18/M07/04